import React from "react";
import TemplateAnime from "../Elementos/templateAnime"


function boku(){
    return(
        <div>
            <TemplateAnime LinkAnime="https://iframe.mediadelivery.net/embed/108181/256fc19c-4069-415c-ab82-d054ce9057ed?autoplay=true" TituloAnime="My Hero Academia " TituloCap="Episodio 1 – Midoriya Izuku: Origen" DescAnime="Midoriya Izuku es un joven que tuvo la desgracia de nacer sin Don, un poder que poseen actualmente el 80 % de los humanos y que él querría usar para convertirse en un héroe como su adorado All Might. Su falta de Don no impide que su objetivo siga siendo acudir a la mejor academia de héroes del país."/>
        </div>
    );
}

export default boku;
